import React from 'react';
import '../../styling/Card.css';
import Task from "../../components/Task/Task.js"
function Objective(props) {
    return (
        <div className="Card">
            <div className="Title">
                {props.title}
            </div>
            <Task title={props.title}/>
        </div>
    );
}

export default Objective;
